      num: 1,
      image: image1,
      class: "Write CSS like a Ninja",
      description: "Rich Armstrong",
      hours: "$25",
    },
    {
      num: 2,
      image: image2,
      class: "Level up in CSS - Advanced Selectors",
      description: "John Rhea",
        hours: "$25",
      },
    {
      num: 3,
      image: image4,
      class: "Style your own portfolio",
      description: " Aga Naplocha",
        hours: "$25",
      },
    {
      num: 4,
      image: image3,
      class: "20 CSS Tricks You Probably Haven't Used Before",
      description: "Chris Dixon",
        hours: "$25",
      },
  ];

  export default cssCards;
